import React from 'react';



function TableI(){
    const [data, setData] = React.useState(null);
    React.useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users")
          .then((res) => res.json())
          .then((data) => setData(data.message));
      }, []);
        

    return(
        <div>
        <table>
            <tr>
                <td>Matricula</td>
                <td>Nombre</td>
                <td>Grupo</td>
                <td>Correo</td>
            </tr> 
        </table>
        <ul>

        {data?.map((user) => (
    <li key={user.id}>{user.name}</li>
        ))}
        </ul>
    </div>
        
    );
};
export default TableI;
